import { React } from 'react';
import { ChannelContext, UserContext } from '../../App';

const CompontentC = () => {
    return (
        <div>
            <UserContext.Consumer>
                {(user) => {
                    return (
                        <ChannelContext.Consumer>
                            {(channel) => {
                                return <h1>my name is {user} channel is {channel}</h1>
                            }}
                        </ChannelContext.Consumer>
                    )
                }}
            </UserContext.Consumer>
        </div>
    )
}

export default CompontentC
